import React from "react";

const Login = () => {


    const onChange = (e) => {
        console.log(e.target);
    }

  return (
    <div className='login_page'>
        <iframe className="login_bgm" width="698" height="393" src="https://www.youtube.com/embed/_kEuHRaZ_Hc" title="[No sound] 괜히 보게 되는 물 속 잉크 번지는 영상 ink smudging in water 2탄" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen>
        </iframe>
        <div className='login_box'>

            <input
            className="id_box"
            id="id"
            name="id"
            placeholder="아이디를 입력해주세요"
            onChange={onChange}
            ></input>

            <input
            className="ps_box"
            id="password"
            name="password"
            type="password"
            placeholder="비밀번호를 입력해주세요"
            onChange={onChange}
            ></input>
            <a href="#" className="login_wan_btn">Login</a>
            <p>비밀번호 찾기 / 아이디 찾기</p>

        </div> 
    </div>
  )
}

export default Login
